通过对 Prometheus client go 的源码阅读，确定了相应http 响应的整个构造流程，脑中浮现了一个比较极端的想法，缓冲响应； 这个适合用来缓存响应内容在一段时间内不会发生改动的 http handler 接口对象 /* get resp cache code start */
type respCacheWriter struct { header http.Header expireat time.Time statuscode int buf []byte update bool
}
func newRespCacheWriter() *respCacheWriter { return &respCacheWriter{ header: make(http.Header, 3), buf: make([]byte, 0, 1024*4), }
}
func (r *respCacheWriter) NotExpire() bool { return time.Now().Before(r.expireat)&&!r.update
}
func (r *respCacheWriter) Update(interval time.Duration) { r.expireat = time.Now().Add(interval) r.update = false
}
func (r *respCacheWriter) Header() http.Header { return r.header
}
func (r *respCacheWriter) SetUpdate() http.Header { return r.update = true
} func (r *respCacheWriter) WriteHeader(statusCode int) { r.statuscode = statusCode
} func (r *respCacheWriter) Write(p []byte) (int, error) { if p == nil { return 0, fmt.Errorf("Write []byte length should not be zero") } r.buf = append(r.buf, p...) return len(r.buf), nil
} type GetRespCache struct { interval time.Duration cache map[string]*respCacheWriter next http.Handler
} func NewGetRespCache(i time.Duration,next http.Handler)GetRespCache{ return GetRespCache{ interval: i, cache: make(map[string]*respCacheWriter,1), next: next, }
} // 这个方法其实也可以 转成私有的，但是不会修改cache 状态所以无所谓 func (g *GetRespCache)UpdateCache()bool{ key := fmt.Sprintf("key%v", r.URL.Query()) if c,ok:=g.cache[key];key&&c!=nil{ c.SetUpdate() }
} func (g *GetRespCache) ServeHTTP(w http.ResponseWriter, r *http.Request) { key := fmt.Sprintf("key%v", r.URL.Query()) if val, ok := g.cache[key]; ok && val != nil&&val.NotExpire() { g.generateResp(val, w) } else { // 调用 write 方法时 缓存响应的 header resp := newRespCacheWriter() g.next.ServeHTTP(resp, r) g.generateResp(resp, w) g.update(key, resp) }
}
func (g *GetRespCache) update(key string, resp *respCacheWriter) { // 这里会更新过期时间和下一个响应状态 resp.Update(g.interval) g.cache[key] = resp
}
func (*GetRespCache) generateResp(val *respCacheWriter, w http.ResponseWriter) { for k, s := range val.header { for _, v := range s { w.Header().Set(k, v) } } w.WriteHeader(val.statuscode) w.Write(val.buf)
}
/* get resp cache code end */ 可以看到其实就是通过中间的代理接口，将被代理的handler 函数的修改缓存起来，根据get 请求的query值来做hash 返回响应的； 过期的时效间隔这里倒是比较粗，用的是同一个过期间隔； 这个get 缓存方案是我最看好的: 第一点基本上是即插即用，迁移性好兼容性好， 第二点是性能更好，缓存占用少，还剩去了内部handler 处理的时间 这个之所以能用在这个场景上，其实是需求造成的，抓取端不改动，数据供应端又允许缓存；所以这个getcache 的方案理论上有奇效，但是最终还是没应用上这个，确定是按照问题2解决后的实现方案来。

